-- 企业福利月统计
 
 -- 固定福利月统计--平均每个循环耗时3.5s 效率有待优化
DROP PROCEDURE IF EXISTS pro_fetch_welfare_nfb_total;
CREATE PROCEDURE `pro_fetch_welfare_nfb_total` (IN p_customer_id VARCHAR (32),IN p_user_id VARCHAR (32))
	BEGIN
	
	DECLARE customerId VARCHAR (32) DEFAULT p_customer_id;
	
	
	DECLARE optUserId VARCHAR (32) DEFAULT p_user_id;
	
	
	DECLARE startTime TIMESTAMP DEFAULT now();
	
	
	DECLARE p_message VARCHAR (10000) DEFAULT '【固定福利月统计】';
	
	
	DECLARE _total INT;
	
	
	DECLARE _organization_id VARCHAR (32);
	
	
	DECLARE done INT DEFAULT 0;
	
	
	DECLARE cur CURSOR FOR SELECT
		organization_id
	FROM
		dim_organization;
	
	
	DECLARE EXIT HANDLER FOR NOT found
	SET done = 1;
	
	OPEN cur;
	
	
	WHILE done = 0 DO
		FETCH cur INTO _organization_id;
	
	SELECT
		count(*) INTO _total
	FROM
		v_dim_emp vde
	INNER JOIN dim_organization org ON vde.organization_id = org.organization_id
	AND vde.customer_id = org.customer_id
	WHERE
		vde.customer_id = customerId
	AND vde.run_off_date IS NULL
	AND vde.organization_id IN (
		SELECT
			t1.organization_id
		FROM
			dim_organization t1
		WHERE
			t1.customer_id = vde.customer_id
		AND locate(
			(
				SELECT
					t.full_path
				FROM
					dim_organization t
				WHERE
					t.customer_id = t1.customer_id
				AND t.organization_id = _organization_id
			),
			t1.full_path
		)
	);
	
	INSERT INTO welfare_nfb_total SELECT
		_organization_id,
		sci.customer_id,
		nfb_id,
		round(sum(wn.welfare_value), 2) AS nfb_total,
		(
			SELECT
				count(vde.emp_id)
			FROM
				welfare_nfb wn1
			INNER JOIN v_dim_emp vde ON vde.emp_id = wn1.emp_id
			AND vde.customer_id = wn1.customer_id
			WHERE
				wn1.`year_month` = (
					SELECT
						max(`year_month`)
					FROM
						welfare_nfb
					WHERE
						customer_id = customerId
				)
			AND wn1.nfb_id = wn.nfb_id
			AND vde.organization_id IN (
				SELECT
					t1.organization_id
				FROM
					dim_organization t1
				WHERE
					t1.customer_id = vde.customer_id
				AND locate(
					(
						SELECT
							t.full_path
						FROM
							dim_organization t
						WHERE
							t.customer_id = t1.customer_id
						AND t.organization_id = _organization_id
					),
					t1.full_path
				)
			)
			AND vde.customer_id = customerId
		) enjoin_nfb_total,
		_total,
		substr(`year_month`, 1, 4),
		NULL,NULL
	FROM
		sys_code_item sci
	INNER JOIN welfare_nfb wn ON sci.sys_code_item_id = wn.nfb_id
	AND sci.customer_id = wn.customer_id
	AND substr(wn.`year_month`, 1, 4) = date_format(now(), '%Y')
	AND wn.customer_id = p_customer_id
	INNER JOIN v_dim_emp vde ON vde.emp_id = wn.emp_id
	AND wn.customer_id = vde.customer_id
	AND vde.organization_id IN (
		SELECT
			t1.organization_id
		FROM
			dim_organization t1
		WHERE
			t1.customer_id = vde.customer_id
		AND locate(
			(
				SELECT
					t.full_path
				FROM
					dim_organization t
				WHERE
					t.customer_id = t1.customer_id
				AND t.organization_id = _organization_id
			),
			t1.full_path
		)
	)
	WHERE
		sci.code_group_id = 'nfb'
	GROUP BY
		_organization_id,
		sci.customer_id,
		nfb_id,
		_total,
		substr(`year_month`, 1, 4);
	END WHILE;
END;



-- 薪酬汇总

-- 更新薪酬明细cr值
CREATE PROCEDURE `pro_update_pay_crValue`(in p_customer_id VARCHAR(32), in p_user_id VARCHAR(32), in p_key2 VARCHAR(50), in p_ym INTEGER(6))
BEGIN
	DECLARE y INT DEFAULT SUBSTR(p_ym FROM 1 FOR 4);
		
	DECLARE customerId VARCHAR(32) DEFAULT p_customer_id;
	DECLARE optUserId VARCHAR(32) DEFAULT p_user_id;

	DECLARE p_message VARCHAR(10000) DEFAULT '【薪酬看板-更新薪酬明细cr值】';
				
		-- 更新cr
	LB_CURSOR_CR:BEGIN

		DECLARE orgId VARCHAR(32);
		DECLARE qv DOUBLE(10,4);
		
		DECLARE payId, empId VARCHAR(32);
		DECLARE cr DOUBLE(10,4);

		DECLARE done INT DEFAULT 0;
		DECLARE s_cur1 CURSOR FOR
			SELECT 
				organization_id orgId, quantile_value qv
			FROM pay_collect WHERE customer_id = customerId	AND `year_month` = p_ym;
																					 
																					 
		DECLARE EXIT HANDLER FOR SQLSTATE '02000' SET done = 1;
					
		OPEN s_cur1;
		FETCH s_cur1 INTO orgId, qv;

			WHILE1: WHILE done != 1 DO
			
				INSERT INTO pay
				(
					pay_id, customer_id, emp_id, usre_name_ch, organization_id, full_path, postion_id, pay_contract, pay_should, pay_actual, salary_actual, welfare_actual, bonus, cr_value, `year_month`,  `year`
				)
				SELECT  
					pay_id,customer_id, emp_id, usre_name_ch, organization_id, full_path, postion_id, pay_contract, pay_should, pay_actual, salary_actual, welfare_actual, bonus, cr, `year_month`,  y
				FROM (
						SELECT 
							pay_id,
							customer_id,
							emp_id,
							usre_name_ch,
							organization_id,
							full_path,
							postion_id,
							pay_contract,
							pay_should,
							pay_actual,
							salary_actual,
							welfare_actual,
							bonus,
							REPLACE(UNHEX(salary_actual), p_key2,'') / qv AS cr,
							`year_month`
						FROM pay 
						WHERE `year_month` = p_ym AND organization_id = orgId
				) t
			ON DUPLICATE KEY UPDATE
					cr_value = t.cr;
			
				FETCH s_cur1 INTO orgId, qv;
			END WHILE WHILE1;
		CLOSE s_cur1;																		

	END LB_CURSOR_CR;
END;

-- 企业福利明细（货币）
drop procedure if exists pro_fetch_welfare_cpm;
CREATE  PROCEDURE `pro_fetch_welfare_cpm`(in p_customer_id VARCHAR(32), in p_user_id VARCHAR(32), IN p_ym INT(6))
BEGIN

	DECLARE customerId VARCHAR(32) DEFAULT p_customer_id;
	DECLARE optUserId VARCHAR(32) DEFAULT p_user_id;
	DECLARE p_message VARCHAR(10000) DEFAULT '【企业福利明细（货币）】';

	IF (SELECT count(1) from `mup-source`.source_welfare_cpm where `year_month` = p_ym) > 0 THEN
		DELETE FROM welfare_cpm WHERE `year_month` = p_ym;

		LB_INSERT:BEGIN
-- 					DELETE FROM welfare_cpm WHERE `year_month` = p_ym;

				INSERT INTO welfare_cpm ( 
				welfare_cpm_id, customer_id, emp_id, cpm_id, welfare_value, `date`, `year_month`
				)
				SELECT 
				id, t.customer_id, t.emp_id, cpm_id, welfare_value, `date`, `year_month` 
					FROM `mup-source`.source_welfare_cpm t 
-- 							INNER JOIN v_dim_emp_1030 t2 on t.emp_id = t2.emp_id  where t.`year_month` BETWEEN 201501 and 201512

-- 						ON DUPLICATE KEY UPDATE
-- 								customer_id = t.customer_id, 
-- 								emp_id = t.emp_id,
-- 								cpm_id = t.cpm_id,
-- 								welfare_value = t.welfare_value,
-- 								`date` = t.`date`,
-- 								`year_month` = t.`year_month`
				;
		END LB_INSERT;
	END IF;
END;

