CREATE  PROCEDURE `pro_fetch_pay`(IN p_customer_id VARCHAR(32), IN p_user_id VARCHAR(32), in p_key2 VARCHAR(50), in p_ym INTEGER(6))
BEGIN

	DECLARE customerId VARCHAR(32) DEFAULT p_customer_id;
	DECLARE optUserId VARCHAR(32) DEFAULT p_user_id;
	DECLARE startTime TIMESTAMP DEFAULT NOW();

	DECLARE p_message VARCHAR(10000) DEFAULT '【薪酬看板-薪酬费用】';

	-- 硬编码
	DECLARE CURDATE DATE DEFAULT '2015-12-18'; --  CURDATE();
	
	DECLARE 5yearhAGo INT DEFAULT DATE_FORMAT(NOW(),'%Y%m') - 500;
	DECLARE limitStart INT;
	DECLARE Y INT DEFAULT SUBSTR(DATE_FORMAT(NOW(),'%Y%m') FROM 1 FOR 4);
	DECLARE m INT DEFAULT SUBSTR(DATE_FORMAT(NOW(),'%Y%m') FROM 5 FOR 6);
	

	INSERT INTO pay (
		pay_id, customer_id, emp_id, usre_name_ch, organization_id, 
		full_path, postion_id, pay_contract, pay_should, pay_actual, 
		salary_actual, welfare_actual, bonus, cr_value, `year_month`, 
		 `year`
	)
	SELECT 
		id,
		customer_id,
		emp_id,
		usre_name_ch,
		organization_id,
		full_path,
		postion_id,
		REPLACE(HEX(pay_contract),p_key2,''), 
		REPLACE(HEX(pay_should),p_key2,''),
		REPLACE(HEX(pay_actual),p_key2,''),
		REPLACE(HEX(salary_actual),p_key2,''),
		REPLACE(HEX(welfare_actual),p_key2,''),
		REPLACE(HEX(bonus),p_key2,''),
		cr_value,
		`year_month`,
	
		`year`
	FROM `mup-source`.source_pay t
	WHERE t.customer_id = customerId AND t.`year_month` = DATE_FORMAT(NOW(),'%Y%m')
	;

END;

-- 薪酬预算表
drop procedure if exists pro_fetch_pay_value;
CREATE  PROCEDURE `pro_fetch_pay_value`(IN p_customer_id VARCHAR(32), IN p_user_id VARCHAR(32), IN p_y INTEGER(4))
BEGIN

	DECLARE customerId VARCHAR(32) DEFAULT p_customer_id;
	DECLARE optUserId VARCHAR(32) DEFAULT p_user_id;


	-- 薪酬预算表
	LB_CURSOR:BEGIN
		
		DECLARE orgId VARCHAR(32);
		DECLARE fp TEXT;
		
		DECLARE done INT DEFAULT 0;
		DECLARE s_cur CURSOR FOR
			SELECT t2.organization_id orgId, t2.full_path fp
			FROM dim_organization t2 
			WHERE t2.customer_id = customerId
			;
		DECLARE EXIT HANDLER FOR SQLSTATE '02000' SET done = 1;
		
		DELETE FROM pay_value WHERE `year` = p_y;
		
		OPEN s_cur;
		FETCH s_cur INTO orgId, fp;
			WHILE1: WHILE done != 1 DO
				-- 汇总父级，祖父级
				INSERT INTO pay_value (
					pay_value_id,
					customer_id,
					organization_id,
					pay_value,
					`year`
				)
				SELECT 
					fn_getId(),
					t.customer_id,
					orgId,
					SUM(pay_value),
					`year`
				FROM `mup-source`.source_pay_value t
				INNER JOIN dim_organization t1 ON t.organization_id = t1.organization_id
				WHERE t.customer_id = customerId 
				AND t.`year` = p_y
				AND LOCATE(fp, t1.full_path)
				;
		
				FETCH s_cur INTO orgId, fp;
			END WHILE WHILE1;
		CLOSE s_cur;
	END LB_CURSOR;
END;




