-- 薪酬汇总过往    pro_fetch_pay_collect_year
drop procedure if exists pro_fetch_pay_collect_year;
CREATE PROCEDURE `pro_fetch_pay_collect_year`(IN p_customer_id VARCHAR(32), IN p_user_id VARCHAR(32), IN p_y INTEGER(4))
BEGIN

	DECLARE customerId VARCHAR(32) DEFAULT p_customer_id;
	DECLARE optUserId VARCHAR(32) DEFAULT p_user_id;
	DECLARE startTime TIMESTAMP DEFAULT now();
	DECLARE p_message VARCHAR(10000) DEFAULT '【薪酬看板-薪酬汇总年过往】';

	DECLARE limitStart INT;
							
			DELETE FROM pay_collect_year WHERE `year` = p_y;
			INSERT INTO pay_collect_year ( pay_collect_year_id, customer_id, organization_id, sum_pay, avg_pay, sum_salary, avg_salary, sum_welfare, avg_welfare, sum_bonus, sum_share, count_share, `year`
			)
			SELECT 
				replace(UUID(), '-', ''),
				customer_id,
				organization_id,
				sum(sum_pay),
				sum(sum_pay) / (sum(avg_emp_num)/12), 
				sum(sum_salary),
				sum(sum_salary) / (sum(avg_emp_num)/12), 
				sum(sum_welfare),
				sum(sum_welfare) / (sum(avg_emp_num)/12), 
				sum(sum_bonus),
				0,0,
				p_y
			FROM pay_collect t
			WHERE t.customer_id = customerId 
				AND	locate(p_y, t.`year_month`)
			GROUP BY t.organization_id
			;

			LB_CURSOR:BEGIN
					
			DECLARE sShare, cShare	INT;

			DECLARE orgId VARCHAR(50);
			DECLARE fp TEXT;
			DECLARE done INT DEFAULT 0;
			DECLARE s_cur CURSOR FOR
				SELECT t2.organization_id orgId, t3.full_path fp
				FROM pay_collect_year t2 
				INNER JOIN dim_organization t3 on t2.organization_id = t3.organization_id
				WHERE t2.customer_id = customerId 
					AND t2.`year` = p_y
				GROUP BY t2.organization_id
				;
			DECLARE EXIT HANDLER FOR SQLSTATE '02000' SET done = 1;

			OPEN s_cur;
			FETCH s_cur INTO orgId, fp;
				WHILE1: WHILE done != 1 DO
					SELECT IFNULL(SUM(now_share),0) sShare, IFNULL(count(emp_id),0) cShare 
					INTO	sShare, cShare
					FROM share_holding t 
					WHERE 
						 t.customer_id = customerId
-- 								AND t.organization_id = orgId 
						AND LOCATE(fp, t.full_path)
						;

-- 							UPDATE pay_collect_year SET sum_share = sShare, count_share = cShare
-- 							WHERE organization_id = orgId AND `year` = p_y AND customer_id = customerId;
					FETCH s_cur INTO orgId, fp;
				END WHILE WHILE1;
			CLOSE s_cur;

		END LB_CURSOR;
END;


-- ******该过程被java代码调用 薪酬汇总****************
-- (并计算50分位值)  pro_fetch_pay_collect
drop procedure if exists pro_fetch_pay_collect_year;
CREATE PROCEDURE `pro_fetch_pay_collect_year`(IN p_customer_id VARCHAR(32), IN p_user_id VARCHAR(32),IN p_ym INTEGER, IN p_key2 VARCHAR(10))
BEGIN

	DECLARE customerId VARCHAR(32) DEFAULT p_customer_id;
	DECLARE optUserId VARCHAR(32) DEFAULT p_user_id;
	DECLARE startTime TIMESTAMP DEFAULT NOW();

	DECLARE p_error INTEGER DEFAULT 0; 
	DECLARE p_message VARCHAR(10000) DEFAULT '【薪酬看板-薪酬汇总】';

	-- 硬编码
	DECLARE CURDATE DATE DEFAULT '2015-12-17'; --  CURDATE();
	
	DECLARE limitStart INT;
	DECLARE Y INT DEFAULT SUBSTR(p_ym FROM 1 FOR 4);
	DECLARE m INT DEFAULT SUBSTR(p_ym FROM 5 FOR 6);
	DECLARE sp, ss, sw, sb DOUBLE(10, 4);

			
	-- 薪酬汇总表
	LB_CURSOR_SUM:BEGIN
		DECLARE orgId VARCHAR(32);
		DECLARE fp VARCHAR(1000);
		DECLARE done INT DEFAULT 0;
		DECLARE s_cur1 CURSOR FOR
	SELECT 
		organization_id orgId,
		full_path fp
		FROM dim_organization WHERE customer_id = customerId;
		DECLARE EXIT HANDLER FOR SQLSTATE '02000' SET done = 1;				
	DELETE FROM pay_collect WHERE `year_month` = p_ym;
	
		OPEN s_cur1;
		FETCH s_cur1 INTO orgId, fp;

		WHILE1: WHILE done != 1 DO

	SELECT 
		IFNULL(SUM(sumPay),0) sp, 
		IFNULL(SUM(sumSalary),0) ss, 
		IFNULL(SUM(sumWelfare),0) sw,  
		IFNULL(SUM(sumBonus),0) sb
		INTO sp,  ss, sw, sb
		-- SELECT sumPay, avgPay, sumSalary, sumWelfare, t2.full_path
		FROM dim_organization t2 
		LEFT JOIN 
		(
		-- 换为万完单位
			SELECT 
			t.organization_id,
			SUM(REPLACE(UNHEX(t.pay_should), p_key2,'')) / 10000 AS sumPay,				 -- 应发薪酬
			SUM(REPLACE(UNHEX(t.salary_actual), p_key2,'')) / 10000 AS sumSalary,  -- 应发工资
			SUM(REPLACE(UNHEX(t.welfare_actual), p_key2,'')) / 10000 AS sumWelfare,
			SUM(REPLACE(UNHEX(t.bonus), p_key2,'')) / 10000 AS sumBonus,
			t1.full_path
			FROM pay t
			INNER JOIN dim_organization t1 ON t.organization_id = t1.organization_id
			WHERE  t.`year_month` = p_ym
			GROUP BY organization_id
		) t ON t.organization_id = t2.organization_id
		WHERE LOCATE(fp, t2.full_path);

		SET @mas = (SELECT month_avg_sum FROM history_emp_count_month t3 
				WHERE `year_month` = p_ym AND t3.organization_id = orgId AND t3.customer_id = customerId AND t3.type=1);
				

		INSERT INTO pay_collect (
			pay_collect_id,customer_id,organization_id,
			sum_pay, avg_pay, avg_emp_num,
			sum_salary, avg_salary,
			sum_welfare, avg_welfare,
			sum_bonus, quantile_value, `year_month`
			) VALUES(
		REPLACE(UUID(),'-',''), customerId, orgId, 
		sp, (sp / @mas), @mas, 
		ss, (ss / @mas),
		sw, (sw / @mas),
		sb, 0, p_ym);
		FETCH s_cur1 INTO orgId, fp;
		END WHILE WHILE1;
		CLOSE s_cur1;
	END LB_CURSOR_SUM;
END;

-- 企业福利月统计（末月清空）pro_fetch_welfare_cpm_total
drop procedure if exists pro_fetch_welfare_cpm_total;
CREATE PROCEDURE `pro_fetch_welfare_cpm_total`(IN p_customer_id VARCHAR(32), IN p_user_id VARCHAR(32))
BEGIN 
  DECLARE customerId VARCHAR(32) DEFAULT p_customer_id;
	DECLARE optUserId VARCHAR(32) DEFAULT p_user_id;
	DECLARE startTime TIMESTAMP DEFAULT now();
	DECLARE p_message VARCHAR(10000) DEFAULT '【企业福利月统计】';
	declare _total int;
  declare _organization_id varchar(32);
	declare done int default 0;
	declare cur cursor for select organization_id from dim_organization;
	declare exit handler for not found set done = 1;
	 
   truncate table  welfare_cpm_total;
   open cur;

		while done = 0 do  
			fetch cur into _organization_id;

      select count(*) into _total  FROM v_dim_emp vde inner JOIN dim_organization org ON vde.organization_id = org.organization_id AND vde.customer_id = org.customer_id WHERE vde.customer_id = 'b5c9410dc7e4422c8e0189c7f8056b5f' AND vde.run_off_date IS NULL AND vde.organization_id IN ( SELECT t1.organization_id FROM dim_organization t1 WHERE t1.customer_id = vde.customer_id AND locate(( SELECT t.full_path FROM dim_organization t WHERE t.customer_id = t1.customer_id AND t.organization_id = _organization_id ), t1.full_path ));
      
      insert into welfare_cpm_total
      select _organization_id,sci.customer_id,cpm_id,round(sum(wc.welfare_value), 2) AS cmp_total,count(DISTINCT vde.emp_id) as enjoin_cmp_total,_total,substr(`year_month`,1,4) ,null,null 
      from sys_code_item sci
      INNER JOIN welfare_cpm wc ON sci.sys_code_item_id = wc.cpm_id
      AND sci.customer_id = wc.customer_id
      AND wc.`year_month`  >= concat(DATE_FORMAT(now(),'%Y'),01) and wc.`year_month`<= concat(DATE_FORMAT(now(),'%Y'),12)
      AND wc.customer_id = p_customer_id
      INNER JOIN v_dim_emp vde ON vde.emp_id = wc.emp_id
      AND wc.customer_id = vde.customer_id
      AND vde.organization_id IN ( SELECT t1.organization_id FROM dim_organization t1 WHERE t1.customer_id = vde.customer_id AND locate(( SELECT t.full_path FROM dim_organization t WHERE t.customer_id = t1.customer_id AND t.organization_id = _organization_id), t1.full_path ))
      WHERE
	     sci.code_group_id = 'cpm'
       GROUP BY cpm_id,_organization_id,sci.customer_id,substr(`year_month`,1,4),_total ;
		end  while;
		close cur;
 end;